import React, { Component } from 'react';
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";
//import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
//import 'react-tabs/style/react-tabs.css';

//import "../Styles/Details.css";

class Details extends Component {

    render() {
        return (
            <div className="container">
                <Carousel dynamicHeight={false} showThumbs={false} infiniteLoop={true}>
                        <div>
                            <img src={require("../Assets/breakfast.jpg").default} alt="myimage" />
                        </div>
                        <div>
                            <img src={require("../Assets/lunch.jpg").default} alt="myimage" />
                        </div>
                        <div>
                            <img src={require("../Assets/dinner.png").default} alt="myimage" />
                        </div>
                        <div>
                            <img src={require("../Assets/snacks.jpg").default} alt="myimage" />
                        </div>
                    </Carousel>
                
            </div>   
        );
    }
}

export default Details;
